Opuntia monacantha, more commonly known prickly pear or drooping prickly pear. Its big trunk grows flat round-shaped branches at the top with drooping upper branches. 
Care:-
-Provide porous soil with adequate drainage. 
-Bright, filtered light and ample airflow.
-Water thoroughly when soil is dry to the touch.
-Never let your succulents sit in water. If you water from beneath by letting the plant sit in a saucer of water, make sure to pour off any excess water after a few minutes.
